import React from 'react'
import { useState } from 'react'
import { StudentItem } from './StudentItem'

export const StudentList = () => {

    const [students, setStudents] = useState([
        {
            name: 'Jan Kowalski',
            description: 'Opis Jana Kowalskiego',
            mail: 'Jan.Kowalski@mail.com',
            tags: ['tag1', 'tag2', 'tag3']
        },
        {
            name: 'Stefan Nowak',
            description: 'Opis Stefana Nowaka',
            mail: 'Stefan.Nowak@mail.com',
            tags: ['tag21', 'tag22', 'tag23']

        },
        {
            name: 'Janusz Janusz',
            description: 'Opis Janusza Janusza',
            mail: 'Janusz.Janusz@mail.com',
            tags: ['tag31', 'tag32', 'tag33']

        },
    ])

    return (
        <>
            {
                students.map((student) => (
                    <StudentItem studentDescription={student.description} studentName={student.name} studentTags={student.tags} />
                ))
            }
        </>
    )
}
